   // first cleaning up old fontsize","                            noderef.all('span').setStyle('fontSize', '');","                            // now previous created span-tags will be marked as temp-selection --> this way the can be removed (retaining innerhtml)","                            noderef.all('.'+ITSA_FONTSIZENODE).replaceClass(ITSA_FONTSIZENODE, ITSA_REFSELECTION);","                            noderef.setStyle('fontSize', val);","                            // now, mark this node, so we know it is made by itsafontsize. This way, we can cleanup when fontsize is generated multiple times (prevent creating span within span)","                            noderef.addClass(ITSA_FONTSIZENODE);","                            // remove the selection-mark before removing tmp-node placeholder: we need to keep the node","                            noderef.removeClass(ITSA_REFSELECTION);","                            itsatoolbar._setCursorAtRef();","                        }","                        else {","                            // Don't forget to place a ITSA_REFEMPTYCONTENT before ITSA_REFNODE --> IE cannot focus cursor inside an empty <span>-element and would otherwise focus just before the outerside <span>-element","                            noderef.replace(\"<span class='\" + ITSA_FONTSIZENODE + \"' style='font-size:\" + val + \"'>\" + ITSA_REFEMPTYCONTENT + ITSA_REFNODE + \"</span>\");","                            itsatoolbar._setCursorAtRef();","                            Y.later(30000, itsatoolbar, itsatoolbar._clearEmptyFontRef);","                        }","                    }","                });","            }","        },","","        /**","        * Defines the execCommand itsafontcolor<br>","        * We need to overrule the standard color execCommand, because in IE the ItsaSelectlist will loose focus on the selection","        * @method _defineExecCommandFontColor","        * @private","        */","        _defineExecCommandFontColo